import data from "../json/painting.json";
import { Counter } from "./Counter";
import { Card } from "./Card";
console.log(data[0].author.tag);
export const App = () => {
  return (
    <div>
      <Counter />
      <Card
        url={data[0].url}
        title={data[0].title}
        authorName={data[0].author.tag}
        profileUrl={data[0].author.url}
        price={data[0].price}
        quantity={data[0].quantity}
      />
    </div>
  );
};
